import React from "react";

export const Footer = () => {
    return (
         <AppBar sx={{ m: 0, p: 0, }} position="static">
      <Container sx={{ m: 0, p: 0 }} maxWidth="xl">
        <Toolbar sx={{ m: 0, p: 0 }}>
          <Box sx={{ m: 0, p: 0, display: { xs: "flex", md: "none" } }}>





          </Box>


        </Toolbar>
      </Container>
    </AppBar>
    );
};

export default Footer;
